import { destinations } from '../data';

export const DestinationDescription = () => {
  return (
    destinations.map(list => {
        return(
            <div className="">
                <h1>{list.name}</h1>
                <p>{list.description}</p>
                <hr />
                {/* Distance */}
                <div className="">
                    <h3>AVG. DISTANCE</h3>
                    <h1>{list.distance}</h1>
                </div>
                {/* Travel time */}
                <div className="">
                    <h3>EST. TRAVEL TIME</h3>
                    <h1>{list.travel}</h1>
                </div>
            </div>
        )
    })
  )
}
